import { Link } from "react-router-dom";
import logo from "../assets/images/logo.jpg";

export const Nav = () => {
  return (
    <div className="container">
      <div className="row">
        <nav>
          <div>
            <Link to="/" className="logo">
              <img src={logo} alt="logo" />
            </Link>
          </div>
        </nav>
      </div>
    </div>
  );
};
